import React from 'react';
import axios from 'axios';
import { Portfolioseaction, Portfoliotitle, Portfoliolist, Portfolioitem, Box, Boximg, Boxoverlay } from './style.js';
class Portfolio extends React.Component {
	state = {
		portfolioes: []
	};
	componentDidMount() {
		axios.get('js/data.json').then((res) => {
			this.setState({ portfolioes: res.data.portfolioes });
		});
	}
	render() {
		const { portfolioes } = this.state;
		const portfolioList = portfolioes.map((item) => {
			return (
				<div key={portfolioItem.id}>
					<Boximg src={portfolioItem.image} alt="" />
					<Boxoverlay>
						<span>Show Image</span>
					</Boxoverlay>
				</div>
			);
		});
		return (
			<Portfolioseaction>
				<Portfoliotitle>
					<span>My</span> Portfolio
				</Portfoliotitle>
				<Portfoliolist>
					<Portfolioitem className="active">All</Portfolioitem>
					<Portfolioitem>HTML</Portfolioitem>
					<Portfolioitem>Photoshop</Portfolioitem>
					<Portfolioitem>Wordpress</Portfolioitem>
					<Portfolioitem>Mobile</Portfolioitem>
				</Portfoliolist>

				<Box>{portfolioList}</Box>
			</Portfolioseaction>
		);
	}
}
export default Portfolio;
